import React, { useState } from "react";
import styles from "./robot.module.css";
import addShoppingCar from "../../assets/images/addShopingCar.svg";
import { CartItem, Goods } from "../../interfaceList";
import data from "../../FakeData/data.json";
import { Link } from "react-router-dom";

interface humanProps {
  id: number;
  name: string;
  email: string;
  price: number;

  addToCart: (goods: Goods) => void;
}

const Robot: React.FC<humanProps & { addToCart: (goods: Goods) => void }> = ({
  id,
  name,
  email,
  price,
  addToCart,
}) => {
  const [goods, setgoods] = useState<Goods>();

  const url = `https://robohash.org/${id}`;

  const handleClick = () => {
    const goods: Goods = {
      id,
      name,
      price,
      img: url,
    };
    addToCart(goods);
  };

  return (
    <ul>
      <li className={styles.frame}>
        <img src={url}></img>
        <p>{name}</p>
        <p>{email} </p>
        {price}
        <Link to={"/shoppingcart"}>
          <a href="#" className={styles.a} onClick={() => handleClick()}>
            buy
          </a>
        </Link>

        <img
          src={addShoppingCar}
          alt="logo"
          className={styles.addShoppingCar}
          onClick={() => handleClick()}
        />
      </li>
    </ul>
  );
};

export default Robot;
